import React from "react";

function Form({handleChange,handleAddTodo,todoData}){
    return(
        <div>
            <form>
                <div></div>

                <input
                type="text"
                id="title"
                placeholder="title"
                onChange={handleChange}
                value={todoData.title}
                required
                />
                    <input
                type="text"
                id="description"
                placeholder="Description"
                onChange={handleChange}
                value={todoData.desription}
                required
                />
                <input
                type="text"
                id="priority"
                placeholder="priority"
                onChange={handleChange}
                value={todoData.priority}
                required
                />
                    <input
                type="text"
                id="status"
                placeholder="status"
                onChange={handleChange}
                value={todoData.status}
                required
                />
            </form>
        </div>
    )
}

export default Form
